/*
 * Domain Function:  pp_insert
 */
ooaofooa_C_PP *
ooaofooa_pp_insert( ooaofooa_C_PP * p_c_pp, ooaofooa_C_PP * p_head_c_pp )
{
  ooaofooa_C_PP * result;ooaofooa_C_PP * c_pp;ooaofooa_C_PP * head_c_pp;
  /* ASSIGN head_c_pp = PARAM.head_c_pp */
  head_c_pp = p_head_c_pp;
  /* ASSIGN c_pp = PARAM.c_pp */
  c_pp = p_c_pp;
  /* ASSIGN result = c_pp */
  result = c_pp;
  /* IF ( empty head_c_pp ) */
  if ( ( 0 == head_c_pp ) ) {
  }
  else if ( ( Escher_strcmp( c_pp->Name, head_c_pp->Name ) <= 0 ) ) {
    /* RELATE c_pp TO head_c_pp ACROSS R4021 */
    ooaofooa_C_PP_R4021_Link_succeeds( c_pp, head_c_pp );
  }
  else {
    ooaofooa_C_PP * prev_c_pp;ooaofooa_C_PP * cursor_c_pp=0;
    /* ASSIGN result = head_c_pp */
    result = head_c_pp;
    /* ASSIGN prev_c_pp = head_c_pp */
    prev_c_pp = head_c_pp;
    /* SELECT one cursor_c_pp RELATED BY head_c_pp->C_PP[R4021.succeeds] */
    cursor_c_pp = ( 0 != head_c_pp ) ? head_c_pp->C_PP_R4021_succeeds : 0;
    /* WHILE ( not_empty cursor_c_pp ) */
    while ( ( 0 != cursor_c_pp ) ) {
    /* IF ( ( c_pp.Name <= cursor_c_pp.Name ) ) */
    if ( ( Escher_strcmp( c_pp->Name, cursor_c_pp->Name ) <= 0 ) ) {
    /* BREAK */
    break;
    }
    else {
    /* ASSIGN prev_c_pp = cursor_c_pp */
    prev_c_pp = cursor_c_pp;
    /* SELECT one cursor_c_pp RELATED BY cursor_c_pp->C_PP[R4021.succeeds] */
    cursor_c_pp = ( 0 != cursor_c_pp ) ? cursor_c_pp->C_PP_R4021_succeeds : 0;
    }
    }
    /* RELATE prev_c_pp TO c_pp ACROSS R4021 */
    ooaofooa_C_PP_R4021_Link_succeeds( prev_c_pp, c_pp );
    /* IF ( not_empty cursor_c_pp ) */
    if ( ( 0 != cursor_c_pp ) ) {
    /* RELATE c_pp TO cursor_c_pp ACROSS R4021 */
    ooaofooa_C_PP_R4021_Link_succeeds( c_pp, cursor_c_pp );
    }
  }
  /* RETURN result */
  return result;
}

